INSERT INTO `productos` (`id`, `nombre_producto`, `descripcion_producto`, `precio`, `id_categoria_producto`, `imagen_producto`, `id_usuarios`, `estado`) VALUES
	(1, 'Celular Xiaomi Redmi Note 8 Global 64 Gb 4 Ram Garantía 12 M', 'XIAOMI REDMI NOTE 8 64 GB + 4 GB RAM <\r\n\r\n\r\n\r\n//ENVIAR CORREO PARA LA FACTURA//\r\n\r\n//CUALQUIER CAMBIO DE LA FACTURA O COLOR DEL PRODUCTO SE DEBE AVISAR CON TIEMPO, DESPUÉS DE REALIZAR LA FACTURA NO SE PUEDE CAMBIAR//\r\n\r\n///POR FAVOR SELECCIONA EL COLOR EN LA PUBLICACIÓN ANTES DE OFERTAR///\r\nModelo de Cargador: Europeo para todos los colores y se envían con adaptador\r\n\r\n\r\n\r\n//MÁXIMO UNA UNIDAD POR COMPRA, SI VA A REALIZAR COMPRA DE VARIOS EQUIPOS DEBE HACERLO EN COMPRAS SEPARADAS//\r\n\r\n\r\n\r\n\r\nBENEFICIOS DE COMPRAR CON TEKSHOP:\r\n\r\n- Garantía directa sin intermediarios.\r\n- Productos Homologados y Certificados directamente con Xiaomi.\r\n- Productos exclusivos y lanzamientos Globales.\r\n- Factura de venta en todas tus compras.\r\n- Equipo de soporte Post Venta Especializado.\r\n\r\n…………………………………………………\r\n\r\nEncontrar un teléfono que te ofrezca mucho a un bajo costo parece una tarea casi imposible ¡Por eso el Redmi Note 8 viene a cumplir con esa misión! Con un procesador SND665 acompañado de 4GB de RAM y 64GB. Pantalla IPS con resolución 1080p en conjunto a un notch tipo gota, ocupando un 90% de ratio de pantalla. Con una batería de 4000 mAH cargador de 10W aunque el teléfono es compatible con cargador de 18W. Sensor de huella trasero. Y lo más destacable son sus cámaras, cuenta con cuatro cámaras traseras, la principal de 48mp, un segundo sensor de 8mp el cual es un gran angular, un sensor de lente macro de 2pm y por ultimo un sensor de profundidad de 2mp. La cámara delantera tampoco se queda atrás con un sensor de 13mp con focal 2.0. Sin dudas con todas estas características, esto es lo mejor de lo mejor en la gama media.\r\n\r\n\r\nESPECIFICACIONES TÉCNICAS\r\n…………………………………………………\r\n\r\n* SO // Android 9 (Miui 10)\r\n\r\n* Sim // DUAL SIM (2 SIMS y 1 micro SD)\r\n\r\n* Dimensiones // 158.3 x 75.3 x 8.4 mm\r\n\r\n* Peso // 190g\r\n\r\n* Materiales // Cristal frontal / posterior (Gorilla Glass 5)\r\n\r\n* Tipo de Pantalla // LCD IPS touchscreen capacitivo, 16M colores\r\n\r\n* Tamaño de Pantalla // 6.3 pulgadas\r\n\r\n* Resolución // 1080 x 2340 pixels\r\n\r\n* Densidad // 409 ppi\r\n\r\n* Protección // Gorilla Glass 5\r\n\r\n* Procesador // Qualcomm SDM665 Snapdragon 665 octa-core 2GHz\r\n\r\n* GPU // Adreno 610\r\n\r\n* Memoria // 4GB RAM, 64GB almacenamiento interno\r\n\r\n* Expansión de Memoria // microSD, hasta 256GB\r\n\r\n* Camaras // Cuádruple, 48 MP (f/1.8, PDAF, EIS) + 8 MP (ultrawide) + 2 MP (f/2.4, macro) + 2 MP (profundidad)\r\n\r\n* Funciones Camaras Trasera // autofocus por detección de fase, flash LED dual, IA, geo-tagging, HDR\r\n\r\n* Vídeo // 2160p@30fps\r\n\r\n* Camara Frontal // 13 MP, f/2.0, 1080p, HDR\r\n\r\n* Wi-Fi // Wi-Fi 802.11 a/b/g/n/ac; Wi-Fi Direct; banda dual\r\n\r\n* Bluetooth // v5.0 LE, A2DP\r\n\r\n* GPS // GPS con soporte A-GPS, GLONASS, BDS\r\n\r\n* USB // USB Type-C 2.0, OTG\r\n\r\n* Puerto infrarrojo // Si\r\n\r\n* Parlante // Altoparlante\r\n\r\n* Conector de audio // Conector de audio 3.5 mm\r\n\r\n* Radio FM // Si\r\n\r\n* Sensores // Acelerómetro / Proximidad / Luz Ambiente\r\n\r\n* Seguridad // Lector de Huellas / Desbloqueo Facial\r\n\r\n* Resistencia al Agua // Capa P2i, resistente a salpicaduras\r\n\r\n* Bateria // Tipo Li-Po / Capacidad 4000 mAh / Cargador incluido de 10W / Carga Rapida 18W', '669000', 105, _binary , 2, 'activo'),
	(2, 'Portátil Acer 53lp Core I5 8va 1tb+128gb Ssd Gtx 1050 4gb', 'PRODUCTO:\r\n\r\nNombre: Portátil Acer 53LP Core i5 8va 1tb+128gb ssd gtx 1050 4gb Win 10\r\nMarca: Acer\r\n\r\nDESCRIPCIÓN:\r\n\r\nExplora y disfruta un nuevo nivel de Gaming más inmersivo con la pantalla Full HD y la potente tecnología del Nitro 5.\r\n\r\nCARACTERÍSTICAS PRINCIPALES:\r\n\r\n-Procesador: Intel Core i5 8300H\r\n-RAM: 8GB\r\n-15.6" Pulgadas\r\n-Disco duro: 1TB + 128GB SSD\r\n-Sistema Operativo: Windows 10\r\n-Tarjeta Gráfica: Nvidia GeForce GTX 1050 4GB DDR5\r\n-Color: Negro\r\n\r\nMÁS DETALLES:\r\n\r\nPeso del paquete: 9 kg\r\nMedidas: 12 x 3 x 21 cm\r\nModelo: AN515-52-53LP\r\nMeses de garantía: 12\r\nCondición: Nuevo\r\nColor: Negro\r\nNombre de color: Negro\r\nEAN: 4710180376562\r\nGTIN: 4710180376562\r\nTamaño de pantalla: 15.6\r\nTipo de pantalla: FHD\r\nTamaño de memoria RAM: 8\r\nUnidad de memoría RAM: Gb\r\nMarca del procesador: Intel\r\nVelocidad del procesador: 2.3\r\nUnidad de velocidad del procesador: GHz\r\nTipo de procesador: corei5\r\nCapacidad del disco duro: 1\r\nUnidad del tamaño de disco duro: Tb\r\nMarca de la tarjeta gráfica: Nvidia GeForce GTX 1050\r\nRAM de la tarjeta gráfica: 4\r\nUnidad del tamaño de RAM de la tarjeta gráfica: Gb\r\nSistema Operativo: Windows 10\r\nContenido del paquete: Portátil, cargador y manuales\r\nSKU: NH.Q3MAL.032_X', '3300000', 129, _binary , 2, 'activo'),
	(3, 'Yamaha Fz 150 Modelo 2016', 'SOAT Y TECNO junio 2020\r\ntransito envigado placa VJW28D\r\n\r\nEl vehículo se encuentra en excelente estado y se entrega al día. El traspaso es inmediato y está incluido en el precio\r\nestamos en Medellín Vendemos motos nuevas y usadas multi-marcas. Recibimos su motocicleta usada en parte de pago.\r\nMedios de pago: Efectivo, Consignación, Tarjeta de crédito y Transferencia bancaria.\r\n-Tenemos financiación directa hasta 24 meses si tienes desde el 30% de cuota inicial.\r\nEn nuestra sde te damos pre-aprobado SOLO con la cédula!!\r\n-CUIDA TU INVERSIÓN!! Instalamos LA ALARMA GPS MAS EFICIENTE DEL MERCADO, acondicionada con power bank garantizando el 100% de efectividad y continuidad de carga.\r\nno interfiere el sistema eléctrico ni afecta la garantía de fábrica de la motocicleta.\r\ntodos los comandos de la app son en español y de fácil uso para comodidad del usuario\r\n', '4000000', 521, _binary , 2, 'activo');
